import React, { Component } from 'react'
import './App.css'
export default class App extends Component {
  render() {
    return (
      <div className="appContainer">
        <div class="list-container">
          <div><ul><li id="list1"></li></ul></div>
          <div><ul><li id="list2"></li></ul></div>
         </div>
      </div>
    )
  }
}
